function Todo
    ({todoText :todoText,  fnc : deleteTodo , todoId})
    
    {
    return (
        <div className="todo" key={todoId}>
            <span className="todo-text">
            {todoText}
            </span>
            <span className="todo-tools">
                <span onClick=
                    { () => {
                    deleteTodo(todoId)
                    } }
                    className="todo-btn todo-delete">x</span>
            </span>
        </div>
    )
}
export default Todo
